import {useGetLaunchesQuery} from "./api/spaceXApi";
import {useState} from "react";

const spaceXLaunches = ({sortArg: number}) => {
    const {data, isLoading, error} = useGetLaunchesQuery(true,
        {
            "sort": {
                "date_utc": sortArg,
            },
            });
    console.log("launches");
    console.log(data);

    return (
        <>{error ? (
            <>Oh no, there was an error</>
        ) : isLoading ? (
            <>Loading...</>
        ) : data ? (
            <>
                <ul>
                    {data.map((launch) => (
                        <li key={launch.id}>{launch.details}</li>
                    ))}
                </ul>
            </>
        ) : null}
        </>
    );
}

export default spaceXLaunches();
